import React, { Component } from 'react'
import './App.css'
import axios from 'axios'

class App extends Component {
    constructor () {
        super()
        this.state = {
            username: ''
        }

        this.handleClick = this.handleClick.bind(this)
    }

    handleClick () {
        console.log('Success!')
        axios.post('http://localhost:7080/connections/create-invitation').then(response => console.log(JSON.stringify(response.invitation_url)))
    }

  render () {
    return (
        <div className='button__container'>
          <button className='button' onClick={this.handleClick ()}> Click Me</button>
        </div>
    )
  }
}
export default App
